import React, {Component} from 'react'
import {FaToggleOff, FaToggleOn, FaTrash} from "react-icons/fa"

const Task = ({id, task, task_status, date, priority, update, undo, deleteTask}: {id: string, task: string, task_status: boolean, date: Date, priority: number, update : () => void, undo : () => void, deleteTask : () => void}) => {    
    return (
        <div>
            <button onClick={update}>
                {task_status ? <FaToggleOn/> : <FaToggleOff/>}
            </button>
            <button onClick={update}>
                {task_status ? <FaToggleOn/> : <FaToggleOff/>}
            </button>
            <button onClick={deleteTask}>
                <FaTrash></FaTrash>
            </button>
            <h2>{task}</h2>
        </div>
    )

}

export default Task
